function About() {
  return (
    <>
    <header>
      Contact Us
    </header>
      <form>
        <label>Full Name</label><br></br>
        <input type="text"></input><br></br>
        <label>Email</label><br></br>
        <input type="text"></input><br></br>
        <label>Message</label><br></br>
        <input type="text"></input><br></br>
      </form>
      <button>Submit</button>

      <footer></footer>
    </>
  );
}
export default About;
